import React from "react";
import {
  AppBar,
  Toolbar,
  Typography,
  Box,
  IconButton,
  Badge,
  Button,
} from "@mui/material";
import { ShoppingCart } from "@mui/icons-material";

export default function Header1() {
  return (
    <AppBar position="static" sx={{ justifyContent: "space-between" }}>
      <Toolbar sx={{ justifyContent: "space-between" }}>
        {/* // Logo or Title */}
        <Typography variant="h6" fontWeight="bold">
          Eventy
        </Typography>
        {/* // Logo or Title */}

        <Box sx={{ display: "flex", gap: 2 }}>
          {menuItems.map(({ label, options }) => (
            <Box key={label}>
              <Button
                onClick={(e) => handleMenuOpen(e, label)}
                endIcon={<ExpandMore />}
                sx={{ color: "black" }}
              >
                {label}
              </Button>
              <Menu
                anchorEl={anchorEls[label]}
                open={Boolean(anchorEls[label])}
                onClose={() => handleMenuClose(label)}
              >
                {options.map((option) => (
                  <MenuItem key={option} onClick={() => handleMenuClose(label)}>
                    {option}
                  </MenuItem>
                ))}
              </Menu>
            </Box>
          ))}
        </Box>

        {/* // Navigation Links */}
        <Box display="flex" alignItems="center" gap={2}>
          <IconButton>
            <Badge badgeContent={4} color="error">
              <ShoppingCart />
            </Badge>
          </IconButton>
          <Button variant="outlined" color="inherit">
            Login
          </Button>
          <Button variant="contained" sx={{ backgroundColor: "blueviolet" }}>
            Sign Up
          </Button>
        </Box>
        {/* // Nav Bar */}
      </Toolbar>
    </AppBar>
  );
}
